INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (1, '4ab638604a52eacc612d63a2b6ede1583947bb6f54ac0742c2e54757730a5d27', 'Квартира 2-комнатная в центре Нового Сада', 'Продается 2-комнатная квартира 65м2 в центре Нового Сада. 3 этаж, лифт, балкон, центральное отопление.', 1401, 0.9900, '', '{}', 'local_algorithms', 0, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:36:06.518507', '2025-09-22 16:36:06.518507');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (3, 'ca825ab73b31b28a2d578f40a04dd30d77c333907fc7249a952f85f17e71804e', 'Керамическая ваза-осьминог ручной работы', 'Уникальная керамическая ваза в форме осьминога. Ручная работа, высота 30см. Идеально подходит для украшения интерьера. Цвет: морская волна с золотистыми акцентами.', 1501, 0.9000, 'Товар представляет собой керамическую вазу, которая предназначена для украшения интерьера, что делает ее подходящей для категории ''Мебель''.', NULL, 'claude-3-haiku-20240307', 1204, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:48:09.570382', '2025-09-22 16:48:09.570382');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (4, '17b4e98f543d13d019e2b88e7c269778fd9152d05aa8df199bea21aeb36180a2', 'iPhone 15 Pro Max 256GB', 'Новый iPhone 15 Pro Max, цвет титановый синий, 256GB памяти. В комплекте зарядка и чехол.', 1101, 0.9900, 'Товар описывает новую модель iPhone, который относится к категории смартфонов.', NULL, 'claude-3-haiku-20240307', 913, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:48:16.604734', '2025-09-22 16:48:16.604734');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (5, 'f50cd8c0cb5405125bf70b41a096cd0ece3605e8b904beab2f1af7c90881a406', 'Mercedes-Benz E220d 2019', 'Mercedes E220d, 2019 год, дизель 2.0, автомат, пробег 45000км. Полная комплектация, состояние отличное.', 1301, 0.9500, 'Данный товар представляет собой подержанный автомобиль Mercedes-Benz E220d 2019 года, что очевидно соответствует категории ''Lični automobili'' (Легковые автомобили).', NULL, 'claude-3-haiku-20240307', 1201, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:48:23.204445', '2025-09-22 16:48:23.204445');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (7, '9c9a0efb59e5807d2d83c752cc5d4e379678a893e9bdf16a7de48273ceb3e05c', 'Вечернее платье с пайетками', 'Красивое вечернее платье черного цвета с пайетками. Размер M (44-46). Длина миди, открытая спина.', 1202, 0.9500, 'Описание товара ясно указывает, что это вечернее платье, которое относится к категории женской одежды.', NULL, 'claude-3-haiku-20240307', 1115, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:48:45.399702', '2025-09-22 16:48:45.399702');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (8, 'a5ac2f67b08f3c20c2aafdf681c04487d362fac332a52ac44fd0aa1aac086e24', 'Product for Sale', 'Please add a description for this product.', 1012, 0.7000, 'Описание товара очень краткое, поэтому сложно сделать точный вывод. Однако, так как товар называется ''Product for Sale'' и не содержит никаких специфических деталей, книги и канцелярские товары кажутся наиболее подходящей категорией.', NULL, 'claude-3-haiku-20240307', 1350, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 17:23:14.761886', '2025-09-22 17:23:14.761886');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (9, 'a4a52d029af54e0e44b378e333312ec07ec793bde977c6dff8f46e2ca54c8df9', 'Серый диван с декоративными подушками', 'Удобный серый диван в хорошем состоянии. Комплектуется декоративными подушками зеленого и розового цветов. Обивка из велюра, мягкое сиденье с эффектом утяжки. На стене над диваном размещены картины. Отлично впишется в современный интерьер.', 1501, 0.9500, 'Товар является диваном, который относится к категории мебели, поэтому наиболее подходящей категорией является ''Nameštaj'' (Furniture).', NULL, 'claude-3-haiku-20240307', 1139, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 17:28:28.099319', '2025-09-22 17:28:28.099319');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (10, 'f21e5b0a7e58368bfc81c5652d318c834a9952345252537fed24cd2bf123727c', 'Кожаный диван синего цвета', 'Двухместный кожаный диван в синем цвете. Имеет потертости на подлокотниках. Мягкие сидения с секциями, комфортная спинка. Диван находится в использованном состоянии, но сохраняет функциональность. Обивка из натуральной кожи, прочная конструкция.', 1501, 0.9000, 'Товар описан как двухместный кожаный диван, который является предметом мебели. Категория ''Мебель'' является наиболее подходящей для данного товара.', NULL, 'claude-3-haiku-20240307', 1085, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 17:32:52.739973', '2025-09-22 17:32:52.739973');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (11, 'e566d787c27e2e23474e79e1a39d8456b6728eb81f644b467a166c33d420b3af', 'Xiaomi Mi 8 Telefon', 'Xiaomi Mi 8 mobilni telefon sa MIUI Global 12.0.3 verzijom. Uređaj ima 128GB ukupne memorije od koje je zauzeto 58,3GB. Android verzija je 10 (QKQ1.190828.002). Poslednje ažuriranje bezbednosti je od 01.09.2020. Telefon je u funkcionalnom stanju sa instaliranim MIUI interfejsom.', 1101, 0.9900, '', '{}', 'local_algorithms', 4, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 09:45:14.426826', '2025-09-23 09:45:14.426826');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (12, 'a017a21a82ac8004e50cd12f4ad8cacb15575ded378c89825d8316d4afb91fd7', 'МФУ Canon PIXMA G3420', 'Струйное многофункциональное устройство Canon PIXMA G3420 в отличном состоянии. Принтер оснащен системой непрерывной подачи чернил (СНПЧ), имеет функции печати, сканирования и копирования. Поддерживает беспроводное подключение через Wi-Fi. ЖК-дисплей для удобного управления. Экономичная печать благодаря заправляемым чернильницам.', 1106, 0.9000, 'Этот товар является многофункциональным устройством (МФУ), которое совмещает в себе функции принтера, сканера и копира, что соответствует категории ''Photo & Video''. Кроме того, устройство поддерживает беспроводное подключение через Wi-Fi, что также характерно для данной категории.', NULL, 'claude-3-haiku-20240307', 1476, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 10:04:26.914223', '2025-09-23 10:04:26.914223');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (13, 'fafba5e52f8215d62014c1b4cd14f45b9a4c05003ae930a3a41cdcf8aecb9e45', 'Skalpel za papir', 'Profesionalni skalpel za precizno sečenje papira i kartona. Metalno kućište sa gumiranom drškom za sigurno držanje. Poseduje mehanizam za zaključavanje sečiva i sistem za zamenu oštrice. Sečivo je izuzetno oštro i pogodno za precizne rezove.', 10232, 0.9500, 'Товар представляет собой профессиональный скальпель для резки бумаги и картона, что соответствует категории строительных инструментов. Описание указывает на точность и надежность инструмента, что подходит для данной категории.', NULL, 'claude-3-haiku-20240307', 1439, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 10:20:07.743761', '2025-09-23 10:20:07.743761');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (14, '98300846d5dadbaa57e8cb607c38cb787c4a0f700dd500eb5c24bbf85085755e', 'Modern Dining Chair', 'Modern dining chair featuring light grey upholstery and wooden legs. The chair appears to be in excellent condition with clean lines and contemporary design. Comfortable padding and durable fabric make it suitable for daily use. The chair has a high back design for added comfort.', 1501, 0.9500, 'Based on the description, this appears to be a modern dining chair designed for daily use in a home or dining setting. The key features like upholstery, wooden legs, and contemporary design indicate this belongs in the Furniture category.', NULL, 'claude-3-haiku-20240307', 1038, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 12:28:53.535246', '2025-09-23 12:28:53.535246');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at) VALUES (16, '7b3fbf1a19ab11a1ff4e30af001fdc68082912f49b86eca9c8d91c55aad2d39d', 'Upholstered Dining Chair', 'Modern upholstered dining chair in beige fabric with wooden legs. Features a high backrest and comfortable padded seat. The chair appears to be in excellent condition with clean upholstery and sturdy construction. Neutral color scheme that would complement most dining room decors.', 1501, 0.9000, 'Товар описывается как обитый тканью стул для столовой, который подходит для использования в интерьере. Это указывает на то, что он относится к категории мебели, а не к другим предметам, таким как книги, электроника или товары для активного отдыха.', NULL, 'claude-3-haiku-20240307', 1421, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 13:37:57.71801', '2025-09-23 13:37:57.71801');
